!function() {
    function e(e) {
        try {
            if ("undefined" == typeof console) return;
            console.log("email decode error: " + e);
        } catch (e) {}
    }

    function t(e) {
        for (var t = document.getElementsByTagName("a"), n = 0; n < t.length; n++) try {
            var r = t[n];
            if (r.href && r.href.indexOf("/cdn-cgi/l/email-protection") > -1) {
                var o = r.href.split("#")[1];
                o = decodeURIComponent(atob(o).replace(/%/g, ""));
                r.href = "mailto:" + o, r.innerHTML = o;
            }
        } catch (a) {
            e(a);
        }
    }

    try {
        document.addEventListener("DOMContentLoaded", function() {
            try {
                t(e);
            } catch (n) {
                e(n);
            }
        });
    } catch (n) {
        e(n);
    }
}();
